import React from 'react';

const CategoriaForm = ({ onChange }) => {
  return (
    <div>
      <label>Categoria (test):</label><br />
      <select name="categoria" onChange={onChange} required>
        <option value="">-- Seleziona --</option>
        <option value="Pulizia tetti">Pulizia tetti</option>
        <option value="Ispezione facciate">Ispezione facciate</option>
      </select>
    </div>
  );
};

export default CategoriaForm;
